import React, {Component} from 'react';

import './MainNavigation.css';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Image from 'react-bootstrap/Image';
import Button from 'react-bootstrap/Button';
import { Link } from 'react-router-dom';
import { NavLink } from 'react-router-dom';

class mainNavigation extends Component {
    constructor(props){
        super(props);
        this.state = {
            isNavbarExpanded: false
        };


    }

    render() {
        return (
        <Navbar collapseOnSelect={true} expand="md" bg="dark" variant="dark">
            <Navbar.Brand>
                <NavLink to="/home">
                    <Image src='./imgs/logo.png'/>
                </NavLink>
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
                    <Nav.Link as={Link} to="/about" className="mainItem">About</Nav.Link>
                    <NavLink as={Link} to="/menu" className="mainItem">Menu</NavLink>
                    <NavLink as={Link} to="/entertainment" className="mainItem">Entertainment</NavLink>
                    <NavLink as={Link} to="/events" className="mainItem">Events</NavLink>
            </Nav>

            {/* AUTH BUTTONS */}
            <Nav className="authBtns">
                <NavLink to="/login">
                        <Button>Login</Button>
                </NavLink>
                <NavLink to="/signup">
                    <Button>Join</Button>
                </NavLink>
            </Nav>
        </Navbar.Collapse>
        </Navbar>
        )
    }
}

export default mainNavigation;
